import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./BookingPage.css";

const BookingPage = () => {
  const [formData, setFormData] = useState({
    userName: "",
    carRegistration: "",
    carType: "",
    carWeight: "",
    pickupLocation: "",
    deliveryLocation: "",
    startDate: "",
    endDate: "",
    conditionDescription: "",
    termsAccepted: false,
    otherInfo: "",
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: type === "checkbox" ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.termsAccepted) {
      alert("You must accept the terms and conditions to proceed.");
      return;
    }

    // Handle form submission logic here (e.g., API call)

    // Navigate to success page or another route
    alert("Booking successfully submitted!");
    navigate("/success");  // Replace with the actual success route
  };

  return (
    <div className="booking-container">
      <h1>Car Rescue Booking</h1>
      <form onSubmit={handleSubmit}>
        <label>User Name:</label>
        <input
          type="text"
          name="userName"
          value={formData.userName}
          onChange={handleChange}
          required
        />

        <label>Car Registration Number:</label>
        <input
          type="text"
          name="carRegistration"
          value={formData.carRegistration}
          onChange={handleChange}
          required
        />

        <label>Car Type:</label>
        <input
          type="text"
          name="carType"
          value={formData.carType}
          onChange={handleChange}
          required
        />

        <label>Car Weight (kg):</label>
        <input
          type="number"
          name="carWeight"
          value={formData.carWeight}
          onChange={handleChange}
          required
        />

        <label>Pickup Location:</label>
        <input
          type="text"
          name="pickupLocation"
          value={formData.pickupLocation}
          onChange={handleChange}
          required
        />

        <label>Delivery Location:</label>
        <input
          type="text"
          name="deliveryLocation"
          value={formData.deliveryLocation}
          onChange={handleChange}
          required
        />

        <label>Service Start Date:</label>
        <input
          type="date"
          name="startDate"
          value={formData.startDate}
          onChange={handleChange}
          required
        />

        <label>Service End Date:</label>
        <input
          type="date"
          name="endDate"
          value={formData.endDate}
          onChange={handleChange}
          required
        />

        <label>Condition of the Car upon Collection:</label>
        <textarea
          name="conditionDescription"
          value={formData.conditionDescription}
          onChange={handleChange}
          required
        />

        <label>Additional Information (Special Instructions):</label>
        <textarea
          name="otherInfo"
          value={formData.otherInfo}
          onChange={handleChange}
        />

        <label>
          <input
            type="checkbox"
            name="termsAccepted"
            checked={formData.termsAccepted}
            onChange={handleChange}
          />
          I accept the <a href="/terms" target="_blank" rel="noopener noreferrer">Terms and Conditions</a>
        </label>

        <button type="submit" disabled={!formData.termsAccepted}>
          Submit Booking
        </button>
      </form>
    </div>
  );
};

export default BookingPage;
